script: |
  super -f text -I q7631.spq | sort > q7631.out

inputs:
  - name: q7631.spq
    data: |
      SELECT - 93 AS col2 FROM tab2 (FORMAT parquet) WHERE + - CAST ( - col2 AS REAL ) + + col1 + + col0 * + 26 * + - col1 BETWEEN - col1 AND - col2 * + col0;
  - name: tab2

outputs:
  - name: q7631.out
    data: |
